let windowW = window.innerWidth;
let windowH = window.innerHeight;
let isLoaded = false;
let glitcher;
/* model: Raukhan Kozhabai, photo by Berik Bazarov */
let imgSrc = 'data:image/jpeg;base64,';

/* by takashi */

function setup() {
    background(0);
    createCanvas(windowW, windowH);
    loadImage(imgSrc, function(img) {
        glitcher = new Glitcher(img);
        isLoaded = true;
    });
}

function draw() {
    clear();
    background(0);

    if (isLoaded) {
        glitcher.show();
    }
}

class Glitcher {
    constructor(img) {
        this.lenghtCanal = 4;
        this.originSize = img;
        this.originSize.loadPixels();
        this.dataDuplicate = [];
        this.fluxLine = [];
        this.changeLine = [];
        this.changeColor = [];
        this.imageHung = [];
        this.flagIn = true;
        this.dataDuplicate = new Uint8ClampedArray(this.originSize.pixels);

        for (let i = 0; i < 1; i++) {
            let o = {
                pixels: null,
                t1: floor(random(0, 1000)),
                speed: floor(random(4, 24)),
                randX: floor(random(24, 80))
            };

            this.fluxLine.push(o);
        }

        for (let i = 0; i < 6; i++) {
            let o = null;
            this.changeLine.push(o);
        }

        for (let i = 0; i < 1; i++) {
            let o = null;
            this.changeColor.push(o);
        }

        for (let i = 0; i < 3; i++) {
            let scatImg = {
                img: null,
                x: 0,
                y: 0
            };

            this.imageHung.push(scatImg);
        }
    }

    replaceData(destImg, srcPixels) {
        for (let y = 0; y < destImg.height; y++) {
            for (let x = 0; x < destImg.width; x++) {
                let r, g, b, a;
                let index;
                index = (y * destImg.width + x) * this.lenghtCanal;
                r = index;
                g = index + 1;
                b = index + 2;
                a = index + 3;
                destImg.pixels[r] = srcPixels[r];
                destImg.pixels[g] = srcPixels[g];
                destImg.pixels[b] = srcPixels[b];
                destImg.pixels[a] = srcPixels[a];
            }
        }
        destImg.updatePixels();
    }

    flowLine(srcImg, obj) {

        let destPixels,
            tempY;
        destPixels = new Uint8ClampedArray(srcImg.pixels);
        obj.t1 %= srcImg.height;
        obj.t1 += obj.speed;
        tempY = floor(noise(obj.t1) * srcImg.height);
        tempY = floor(obj.t1);
        for (let y = 0; y < srcImg.height; y++) {
            if (tempY === y) {
                for (let x = 0; x < srcImg.width; x++) {
                    let r, g, b, a;
                    let index;
                    index = (y * srcImg.width + x) * this.lenghtCanal;
                    r = index;
                    g = index + 1;
                    b = index + 2;
                    a = index + 3;
                    destPixels[r] = srcImg.pixels[r] + obj.randX;
                    destPixels[g] = srcImg.pixels[g] + obj.randX;
                    destPixels[b] = srcImg.pixels[b] + obj.randX;
                    destPixels[a] = srcImg.pixels[a];
                }
            }
        }
        return destPixels;
    }

    shiftLine(srcImg) {

        let offsetX;
        let rangeMin, rangeMax;
        let destPixels;
        let rangeH;

        destPixels = new Uint8ClampedArray(srcImg.pixels);
        rangeH = srcImg.height;
        rangeMin = floor(random(0, rangeH));
        rangeMax = rangeMin + floor(random(1, rangeH - rangeMin));
        offsetX = this.lenghtCanal * floor(random(-40, 40));

        for (let y = 0; y < srcImg.height; y++) {
            if (y > rangeMin && y < rangeMax) {
                for (let x = 0; x < srcImg.width; x++) {
                    let r, g, b, a;
                    let r2, g2, b2, a2;
                    let index;

                    index = (y * srcImg.width + x) * this.lenghtCanal;
                    r = index;
                    g = index + 1;
                    b = index + 2;
                    a = index + 3;
                    r2 = r + offsetX;
                    g2 = g + offsetX;
                    b2 = b + offsetX;
                    destPixels[r] = srcImg.pixels[r2];
                    destPixels[g] = srcImg.pixels[g2];
                    destPixels[b] = srcImg.pixels[b2];
                    destPixels[a] = srcImg.pixels[a];
                }
            }
        }
        return destPixels;
    }

    shiftRGB(srcImg) {

        let randR, randG, randB;
        let destPixels;
        let range;

        range = 16;
        destPixels = new Uint8ClampedArray(srcImg.pixels);
        randR = (floor(random(-range, range)) * srcImg.width + floor(random(-range, range))) * this.lenghtCanal;
        randG = (floor(random(-range, range)) * srcImg.width + floor(random(-range, range))) * this.lenghtCanal;
        randB = (floor(random(-range, range)) * srcImg.width + floor(random(-range, range))) * this.lenghtCanal;

        for (let y = 0; y < srcImg.height; y++) {
            for (let x = 0; x < srcImg.width; x++) {
                let r, g, b, a;
                let r2, g2, b2, a2;
                let index;

                index = (y * srcImg.width + x) * this.lenghtCanal;
                r = index;
                g = index + 1;
                b = index + 2;
                a = index + 3;
                r2 = (r + randR) % srcImg.pixels.length;
                g2 = (g + randG) % srcImg.pixels.length;
                b2 = (b + randB) % srcImg.pixels.length;
                destPixels[r] = srcImg.pixels[r2];
                destPixels[g] = srcImg.pixels[g2];
                destPixels[b] = srcImg.pixels[b2];
                destPixels[a] = srcImg.pixels[a];
            }
        }

        return destPixels;
    }

    getRandomRectImg(srcImg) {
        let startX;
        let startY;
        let rectW;
        let rectH;
        let destImg;
        startX = floor(random(0, srcImg.width - 30));
        startY = floor(random(0, srcImg.height - 50));
        rectW = floor(random(30, srcImg.width - startX));
        rectH = floor(random(1, 50));
        destImg = srcImg.get(startX, startY, rectW, rectH);
        destImg.loadPixels();
        return destImg;
    }

    show() {

        this.replaceData(this.originSize, this.dataDuplicate);

        let n = floor(random(100));
        if (n > 75 && this.flagIn) {
            this.flagIn = false;
            setTimeout(() => {
                this.flagIn = true;
            }, floor(random(40, 400)));
        }
        if (!this.flagIn) {
            push();
            translate((width - this.originSize.width) / 2, (height - this.originSize.height) / 2);
            image(this.originSize, 0, 0);
            pop();
            return;
        }

        this.fluxLine.forEach((v, i, arr) => {
            arr[i].pixels = this.flowLine(this.originSize, v);
            if (arr[i].pixels) {
                this.replaceData(this.originSize, arr[i].pixels);
            }
        });

        this.changeLine.forEach((v, i, arr) => {
            if (floor(random(100)) > 50) {
                arr[i] = this.shiftLine(this.originSize);
                this.replaceData(this.originSize, arr[i]);
            } else {
                if (arr[i]) {
                    this.replaceData(this.originSize, arr[i]);
                }
            }
        });

        this.changeColor.forEach((v, i, arr) => {
            if (floor(random(100)) > 65) {
                arr[i] = this.shiftRGB(this.originSize);
                this.replaceData(this.originSize, arr[i]);
            }
        });

        push();
        translate((width - this.originSize.width) / 2, (height - this.originSize.height) / 2);
        image(this.originSize, 0, 0);
        pop();

        this.imageHung.forEach(obj => {
            push();
            translate((width - this.originSize.width) / 2, (height - this.originSize.height) / 2);
            if (floor(random(100)) > 80) {
                obj.x = floor(random(-this.originSize.width * 0.3, this.originSize.width * 0.7));
                obj.y = floor(random(-this.originSize.height * 0.1, this.originSize.height));
                obj.img = this.getRandomRectImg(this.originSize);
            }
            if (obj.img) {
                image(obj.img, obj.x, obj.y);
            }
            pop();
        });
    }
}